import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/optimizacion.css';

class SeccionForm extends React.Component{
    render(){
        return(
            <div>
                <div ClassName="encabezado">
                    <h2><i ClassName="fas fa-ice-cream"></i> Sabores a producir</h2>
                    <div ClassName="form-group row">
                        <div ClassName="col-9 text">
                            <h4>Sabor</h4>
                        </div>
                    </div>
                    <div ClassName="col-3">
                        <h4><i ClassName="fas fa-chart-line"></i> Demanda</h4>
                    </div>
                </div>
            </div>
        )
    }
}

export default SeccionForm;
